Вы когда-нибудь думали о тематической съёмке на природе? А может быть в студии? Есть желание воплотить художественные идеи, которые так давно ждут своего часа? Хотите примерить на себя новый образ, пережить неизвестные ранее эмоции? Если на какой-то из этих вопросов Вы ответили - «Да», то значит пора задуматься над реализацией желаемого. 
• 
Я предлагаю Вам проведение съемки «под ключ». В неё будут включены такие аспекты, как: 
- личная встреча перед съёмкой; 
-определение вектора развития съёмки и её основной концепции, подбор референсов; 
-помощь в выборе локаций, образа и сопутствующих им элементов; 
-проведение и организация самого процесса съёмки, включая тайминг и техническое оснащение всем необходимым; 
-совместный просмотр полученного материала и отборка лучших, по Вашему мнению, кадров; 
-авторская ретушь выбранных снимков. 
• 
Так же, в качестве приятного бонуса, по завершению съемки Вы получите подарочный комплект напечатанных на бумаге или пенокартоне снимков, которые позволят украсить альбом или интерьер. 
• 
При возникновении любых вопросов - пишите в директ, удобные Вам мессенджеры или звоните: 
+7-981-842-42-57 
